def main():
    # np.set_printoptions(threshold=sys.maxsize, suppress=True)

    td = TestData()
    nominal_sweep = perception.spherical_to_cartesian(perception.parse_sweep(td.nominal_input['lidarSweep']))
    few_feet_back_input = perception.spherical_to_cartesian(perception.parse_sweep(td.few_feet_back_input['lidarSweep']))
    left_column_input = perception.spherical_to_cartesian(perception.parse_sweep(td.left_column_input['lidarSweep']))
    bottom_trench_sweep = perception.spherical_to_cartesian(perception.parse_sweep(td.bottom_trench_input['lidarSweep']))
    center = np.array([[0, 0],])

    fig, ((ax0, ax1), (ax2, ax3)) = plt.subplots(2, 2)

    ax0.set_title('Sweep from Field Center')
    ax0.plot(nominal_sweep[:, 0], nominal_sweep[:, 1], color=(0.15, 0.65, 0.65, 0.2), marker='.', linestyle='')
    ax0.plot(center[:, 0], center[:, 1], color=(1.0, 0.37, 0.22, 1.0), marker='>', linestyle='')
    ax0.axis('equal')
    ax0.set(xlabel='X (meters)', ylabel='Y (meters)')

    ax1.set_title('Sweep from Few Feet Back')
    ax1.plot(few_feet_back_input[:, 0], few_feet_back_input[:, 1], color=(0.15, 0.65, 0.65, 0.2), marker='.', linestyle='')
    ax1.plot(center[:, 0], center[:, 1], color=(1.0, 0.37, 0.22, 1.0), marker='>', linestyle='')
    ax1.axis('equal')
    ax1.set(xlabel='X (meters)', ylabel='Y (meters)')

    ax2.set_title("Sweep from Left Column")
    ax2.plot(left_column_input[:, 0], left_column_input[:, 1], color=(0.15, 0.65, 0.65, 0.2), marker=".", linestyle='')
    ax2.plot(center[:, 0], center[:, 1], color=(1.0, 0.37, 0.22, 1.0), marker='>', linestyle='')
    ax2.axis("equal")
    ax2.set(xlabel='X (meters)', ylabel='Y (meters)')

    ax3.set_title("Sweep from Bottom Trench")
    ax3.plot(bottom_trench_sweep[:, 0], bottom_trench_sweep[:, 1], color=(0.15, 0.65, 0.65, 0.2), marker=".", linestyle='')
    ax3.plot(center[:, 0], center[:, 1], color=(1.0, 0.37, 0.22, 1.0), marker='>', linestyle='')
    ax3.axis("equal")
    ax3.set(xlabel='X (meters)', ylabel='Y (meters)')

    plt.show()


if __name__ == '__main__':
    main()
